import { Text,Box } from"native-base"
export default Post = ({item})=>{
    if(item.id){
        return (<Box>
            <Box>
                 <Text>
                      {item.name}
                 </Text>
            </Box>
        </Box>)
    }
    return <Text>No Post</Text>
}
